import styled from 'styled-components'

export const Footer = styled.footer`
	display: flex;
	align-items: center;
	justify-content: center;
	flex-direction: column;
	height: 100%;
	background: #5D3033;
`

export const FooterTextTop = styled.div`
	font-family: Open Sans;
	font-size: 3vh;
	font-style: normal;
	font-weight: 400;
	line-height: 49px;
	letter-spacing: 0em;
	text-align: center;
	margin-top: 30px;
	color: #fff;
`
export const FooterText = styled.div`
	font-family: Open Sans;
	font-size: 3vh;
	font-style: normal;
	font-weight: 400;
	letter-spacing: 0em;
	text-align: center;
	color: #fff;
`
export const Image = styled.img`
	left: 55.71%;
	right: 40.95%;
	top: 61.81%;
	bottom: 22.65%;
	width: 48px;
	height: 48px;
	margin: 20px;
`
export const SigImage = styled.img`
	left: 55.71%;
	right: 40.95%;
	top: 61.81%;
	bottom: 22.65%;
	width: 48px;
	height: 48px;
	padding: 10px;
`
export const SigContainer = styled.div`
	display: flex;
	align-self: flex-end;
`


export const Signature = styled.p`
	font-family: Open Sans;
	font-style: normal;
	font-weight: 400;
	line-height: 49px;
	letter-spacing: 0em;
	text-align: center;
	color: #fff;

`
